Hesap iptal işleminin bir sonraki adımına geçmeden önce, BitMart hesap iptalinin geri alınamaz bir işlem olduğunu lütfen unutmayın. Lütfen BitMart hesabıyla ilgili tüm bilgi ve verileri kendiniz yedekleyin. BitMart hesabınız iptal edildikten sonra, aşağıdakiler dahil ancak bunlarla sınırlı olmamakla birlikte, hesabı tekrar kullanamazsınız:

(1) Giriş yapamaz veya BitMart hizmetini kullanamazsınız (üçüncü taraf giriş yöntemi dahil);

(2) Hesap iptal edildikten sonra, giriş yaptığınız ve hesap aracılığıyla kullandığınız ürün ve hizmetler altındaki tüm içerik, bilgi, veri ve kayıtlar silinecek veya anonimleştirilecek ve bundan sonra hesabınızı geri alamayacak, erişemeyecek veya kullanmaya devam edemeyeceksiniz. Geri alamamakla birlikte ve bizden geri alma talebinde bulunma hakkına sahip olmayacaksınız (yasalarca aksi belirtilmedikçe);

(3) Hesabınıza ilişkin olarak başka kullanıcılar tarafından şikayette bulunulması, emniyet teşkilatınca soruşturmaya tabi tutulması veya BitMart hesap iptali sırasında dava veya tahkime maruz kalması durumunda, BitMart iptal işlemini bildirimde bulunmaksızın sonlandırma hakkını saklı tutar.

BitMart hesabınızın iptal edilmesi, iptal edilmeden önce hesabınızda gerçekleştirilen herhangi bir işlem için sorumluluğunuzu reddetme hakkı sağlamaz.
